import $ from 'jquery'

import { addCourseToCart } from './actions/add-course-to-cart'
import { changePacks } from './actions/change-packs'

export default () => {
  $('input[type=radio]').on('change', ({ currentTarget }) => {
    changePacks($(currentTarget))
  })

  $('[data-add-cart]').on('click', ({ currentTarget }) => {
    addCourseToCart($(currentTarget))
  })
}

// @flow

export const changePacks = ($radio: JQuery) => {
  const value = String($radio.val())

  const id = value.split('#')[0]
  const price = value.split('#')[1]
  const $btn = $radio.parents('[data-packs-item]').find('[data-add-cart]')

  $btn.removeClass('disabled').text(`Купить за ${price} ₽`).attr('data-id', id)
}

// @flow

import { pendingActions } from 'common/pending-actions'
import { redirectToCheckout } from 'common/redirect'
import { FoxfordService } from 'services/foxford/index'

export const addCourseToCart = async ($btn: JQuery) => {
  if ($btn.hasClass('disabled')) {
    return
  }

  const id = $btn.attr('data-id')

  await FoxfordService.user.pushEvent({ action: 'conversion', label: 'coach' })
  await pendingActions.addCartItem('coach_lesson', 'coach_product', Number(id))

  redirectToCheckout()
}


